import React,{useEffect} from "react";
import ImageCard from "../ImageCard/ImageCard";
import { useDispatch, useSelector } from "react-redux";
import {getAllImages, fetchAsyncImages} from "../../features/Images/imageSlice";
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import Header from "../Header";
import './Tree.css';

const Tree = () => {
    const dispatch = useDispatch();
    useEffect(()=>{
        dispatch(fetchAsyncImages("festivals"));
    },[dispatch]);

    const images = useSelector(getAllImages);
    let renderImages= "";

    renderImages =
    (
        images.hits.map((image, index) => (
        <ImageCard key={index} data={image} />
      ))
    );
    return (
        <div className="container">
          <Header/>
            <div className="image-container">{renderImages}</div>
        </div>
    );
};

export default Tree;
